import './App.css';
import io from 'socket.io-client';


function App() { 
  const room  = prompt("Enter room name");
  const socket = io(`ws://192.168.29.13:8085/?room=${room}`);
  socket.on('connect',()=>{
    console.log(socket.id);
  })

  socket.emit('player1ToServer',{pieceId:4,x0:1,x1:2,y0:3,y1:4})

  return (
    <>
    <h1>Hello world !!!</h1>
    </>
  );
}

export default App;
